const [statoActive, changeStatoActive] = useState(false)

const ActiveClass = () => {
changeStatoActive(true) 
}

const DisactiveClass = () => {
changeStatoActive(false) 
}


return(
<div className=''>
<div className='container p-0 bg-primary d-flex justify-content-center flex-wrap'>
<div className=' col-6 p-2'>
<div className=' p-2 rounded'>
<div className={styleSearchFilter.TitleSCard}>title</div>
<div onBlur={DisactiveClass} onFocus={ActiveClass} className={`p-2 d-flex rounded ${styleSearchFilter.activeStile}
${statoActive && styleSearchFilter.activeStr}`}
>
<div>
<img className={statoActive && styleSearchFilter.activeStrd} style={{'width': '50px', 'marginRight':'20px'}}
src={search} alt="icona search"></img>
</div> 
<input className={`form-control ${styleSearchFilter.activeSt} `}></input>   
</div>
</div>    
</div>
</div>
</div>
)};

